exports=async function(url,bid,cid,options){const{parseContentPaginate,trimContentFragment,getLinkElement}=await require("transcode/parse_content");return parseContentPaginate(page=>1===page?url:url.replace(".html",`_${page}.html`),{cleaner:html=>trimContentFragment(html,/xsDetail[^>]+>/)},{clientOptions:{...(options&&options.clientOptions)},hasNextFn:html=>null!=/\/\d+_\d+\.html/.exec(getLinkElement(html,"id=\"nextUrl\"")),preprocess:html=>html.replace(/<div[^>]*>(?:\s*<(?:ins|script)[^>]*>[^<]*<\/(?:ins|script)>)+\s*<\/div>/g,"")})};